# ------------------------------------------------------------------------------
# <数据源配置文件说明>
# 
# 支持动态加载
#
# DEFAULT_FC_REQNUM为bs的广告请求条数
# DEFAULT_NKS_REQNUM为nks的广告请求条数
# 若数据源没有为自己配置广告请求条数，则使用以上两个默认值
#
# SRC_NUM为数据源个数
# SRC_ID_x为数据源id,其中x为数据源在该配置文件中的序号,下同
# SRC_INNER/OUTER_CMATCH_x为数据源的内/外部cmatch
# SRC_TYPE_x为数据源类型,类型唯一不可叠加:
#     0:代表im
#     2:代表ppim
#     4:代表pp
# SRC_FLOW_TYPE_x为数据源的流量类型:
#     0x00:代表未知
#     0x01:代表ps
#     0x02:代表wise
#     0x04:代表百度自主流量
#     0x08:代表联盟流量
#     0x10:代表优选流量
#     0x20:代表知道流量
#     0x100:代表地图流量
#     0x200:代表feed流量
#     0x400:代表wise_ns流量
#     流量类型可叠加,例如无线自主优选流量的类型为22(0x02+0x04+0x10=0x16=22)
#     不对流量类型的正确性进行校验,例如不会对0x01和0x02的冲突进行校验,需要人为保证
# SRC_CTR_CMATCH_x为数据源的ctr cmatch，是ctr模型选择的依据
# SRC_FC_REQNUM_x(可选)为数据源请求bs库的广告条数，若没有配置则使用DEFAULT_FC_REQNUM的值
# SRC_NKS_REQNUM_x(可选)为数据源请求nks库的广告条数，若没有配置则使用DEFAULT_NKS_REQNUM的值
# SRC_SWITCH_ON表示该数据源是否返回广告,新增数据源类需求,如果ASP/前端模板/router已经上线,该数据源的请求已能够发到AS,
#     则特别注意以下情况:1.在RB的反向对照里,务必关闭该开关.
#                        2.RB bin未推全,务必关闭该开关.否则会走默认TYPE(im,ppim,pp)的pack逻辑,返回非预期广告.
#     0:不返回广告
#     1:正常返回广告
# ------------------------------------------------------------------------------
